import styled from "styled-components";
import Card from "@mui/material/Card";
import { CardMedia } from "@mui/material";


const StyledCard = styled(Card)`
    color: red;
    margin: auto;
`;

export default StyledCard;


const styledCardMedia = styled(CardMedia)`
    width: 100%;
    height: 100%;

`
